visitScheduleRule:
"use strict";
({ params, imports }) => {
  const encounter = params.entity;
  const moment = imports.moment;
  const scheduleBuilder = new imports.rulesConfig.VisitScheduleBuilder({encounter});

  const condition11 = new imports.rulesConfig.RuleCondition({encounter}).when.valueInEncounter("b3891d21-307b-4f70-9454-a7e4c27aa6dd").defined.matches();

  const condition12 = new imports.rulesConfig.RuleCondition({encounter}).when.valueInEncounter("724bc1b1-333a-4542-8c8a-c2a1c708cefc").containsAnswerConceptName("a50c3905-f21c-4a67-9c70-7fa92e883ace").matches();

  const condition13 = new imports.rulesConfig.RuleCondition({encounter}).when.valueInEncounter("724bc1b1-333a-4542-8c8a-c2a1c708cefc").containsAnswerConceptName("956bb006-cbdc-489e-968c-6cf86cbc99cb").matches();

  if(condition11 ){
    const earliestDate = moment(encounter.getObservationReadableValue('b3891d21-307b-4f70-9454-a7e4c27aa6dd')).add(30, 'days').toDate();
    const maxDate = moment(encounter.getObservationReadableValue('b3891d21-307b-4f70-9454-a7e4c27aa6dd')).add(37, 'days').toDate();
    scheduleBuilder.add({name: "VHND Supportive Supervision - Regular visit", encounterType: "VHND Supportive Supervision visit", earliestDate, maxDate});  
}
    if(condition12 ){
    const earliestDate = moment(encounter.encounterDateTime).add(30, 'days').toDate();
    const maxDate = moment(encounter.encounterDateTime).add(37, 'days').toDate();
    scheduleBuilder.add({name: "VHND Supportive Supervision - initial visit", encounterType: "VHND Supportive Supervision visit", earliestDate, maxDate});  
}
    if(condition13 ){
    const earliestDate = moment(encounter.encounterDateTime).add(30, 'days').toDate();
    const maxDate = moment(encounter.encounterDateTime).add(37, 'days').toDate();
    scheduleBuilder.add({name: "VHND Supportive Supervision revival", encounterType: "VHND Supportive Supervision visit", earliestDate, maxDate});  
}

  return scheduleBuilder.getAll();
};
